int lafatele_write_reg_settings(struct cam_sensor_ctrl_t *s_ctrl, struct cam_sensor_i2c_reg_array *i2c_sesting, uint32_t regs_size){
	int rc = 0;
	struct cam_sensor_i2c_reg_setting  i2c_reg_settings = {0};
	struct cam_sensor_i2c_reg_array    *reg_sestings     = i2c_sesting;

	i2c_reg_settings.addr_type = 2;
	i2c_reg_settings.data_type = 2;
	i2c_reg_settings.size = regs_size;
	i2c_reg_settings.reg_setting = reg_sestings;
	rc = camera_io_dev_write(&s_ctrl->io_master_info,&i2c_reg_settings);
	if (rc) {
		CAM_ERR(CAM_EEPROM, "page init failed rc %d", rc);
	}

	return rc;
}

int lafatele_oplus_cam_insensor_eeprom(struct cam_sensor_ctrl_t *s_ctrl, uint8_t *otp_data_out)
{
	int rc = 0;
	int page_count = 598;
	struct cam_sensor_i2c_reg_setting  i2c_reg_settings = {0};
	int read_data_offset = 0;

	CAM_ERR(CAM_EEPROM, "init_pre1 start");

	rc = lafatele_write_reg_settings(s_ctrl, &lafatele_regs_info.init_pre1_regs[0][0], lafatele_regs_info.init_pre1_regs_num);

	CAM_ERR(CAM_EEPROM, "init_pre1 end");

	mdelay(1);

	CAM_ERR(CAM_EEPROM, "init_pre2 start");

	rc = lafatele_write_reg_settings(s_ctrl, &lafatele_regs_info.init_pre2_regs[0][0], lafatele_regs_info.init_pre2_regs_num);

	CAM_ERR(CAM_EEPROM, "init_pre2 end");

	mdelay(20);

	CAM_ERR(CAM_EEPROM, "init start");

	rc = lafatele_write_reg_settings(s_ctrl, &lafatele_regs_info.init_regs[0][0], lafatele_regs_info.init_regs_num);

	CAM_ERR(CAM_EEPROM, "init end");

	if (rc) {
		CAM_ERR(CAM_EEPROM, "page init failed rc %d", rc);
		return rc;
	}
	mdelay(33);

	for (int idx = 0; idx < page_count; idx++) {
		i2c_reg_settings = (struct cam_sensor_i2c_reg_setting){0};

		uint16_t page_addr;

		if (idx < 578) {
			page_addr = 0x14 + idx;
		} else {
			page_addr = 0x4FF + (idx - 578);
		}

		lafatele_regs_info.load_regs[0][0].reg_data = page_addr;

		i2c_reg_settings.addr_type = 2;
		i2c_reg_settings.data_type = 2;
		i2c_reg_settings.size = lafatele_regs_info.load_regs_num;
		i2c_reg_settings.reg_setting = &lafatele_regs_info.load_regs[0][0];

		CAM_INFO(CAM_EEPROM, "Loading page: idx=%d, page_addr=0x%x", idx, page_addr);
		CAM_INFO(CAM_EEPROM, "load_regs_addr:0x%x, load_regs_data:0x%x",
				lafatele_regs_info.load_regs[0][0].reg_addr,
				lafatele_regs_info.load_regs[0][0].reg_data);


		rc = camera_io_dev_write(&s_ctrl->io_master_info, &i2c_reg_settings);
		if (rc) {
			CAM_ERR(CAM_EEPROM, "page load failed for idx=%d, page_addr=0x%x, rc %d", idx, page_addr, rc);
			return rc;
		}
		mdelay(1);

		struct cam_eeprom_map_t *emap = &lafatele_map_info.eeprom_page_map[0];
		rc = camera_io_dev_read_seq(&s_ctrl->io_master_info,
				emap->addr,
				&otp_data_out[read_data_offset],
				emap->addr_type,
				emap->data_type,
				emap->valid_size);

		if (rc) {
			CAM_ERR(CAM_EEPROM, "Failed to read data for idx=%d, page_addr=0x%x, rc=%d", idx, page_addr, rc);
			return rc;
		}

		read_data_offset += emap->valid_size;
	}



	return rc;
}

